  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Squaw
  Creek National Wildlife Refuge outlines Refuge accomplishments during the 1987 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the management plan and research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, haying, fire management,
  and wilderness and special areas. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, other migratory birds, game mammals, other resident wildlife,
  animal control, and disease prevention and control. The public uses of the Refuge
  described in this report include interpretive programs, fishing, wildlife observation,
  other wildlife oriented recreation, camping, picnicking, and law enforcement. The
  equipment and facilities section of the report provides information about new construction,
  major maintenance, equipment utilization and replacement, and communication systems.
  Cooperative programs and items of interest are provided at the end. Photographs
  and brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
